import React from 'react';
import '../../src/scss/Content.scss';

class Content extends React.Component {
    render() {
        return (
            <div className='Content'>
                <div className='Text-content'>
                    <h1>More </h1>
                    <p> </p>
                </div>
            </div>
        );
    }
}

export default Content;
